function loadModalView(b){var a=$(b).html();$(b).html('<i class="fas fa-spinner"></i>');$.get("/get-modal",{modal_template:$(b).attr("data-modal-template"),modal_title:$(b).attr("data-modal-title"),params_json:$(b).attr("data-modal-params-json"),},function(c){$("html body").append(c.html);$("#"+c.modal_id).modal();$(b).html(a);$('[data-toggle="tooltip"]').tooltip("hide");$("#"+c.modal_id).on("hidden.bs.modal",function(d){$("#"+c.modal_id).remove()})})};